volume-CSS:
#volumeLevelContainer {
transform: rotate(180deg);
overflow: hidden;
background-color: white;
width: 20%;
height: 90%;
margin-top: 5%;
margin-left: 10%;
margin-right: 5%;
float: right;
border-radius: 10em;
}
#volumeLevelTop {
background-color: #01e301;
width: 100%;
height: 100%;
}
#buttonContainer {
float: right;
height: 100%;
width: 60%;
}
.button {
display: block;
width: 100%;
height: calc((100%/3) - (2.5px * 3));
padding: 0;
margin-top: 5px;
transition: background-color 0.1s;
}
.mutedColor {
background-color: red !important;
}
.clickColor {
